import React from "react";

function HelloDiv() {
  return <h1>Hello! My name is Steven</h1>;
  return <div>
    <ul>
    <li>I like sports</li>;
    <li>I like my dog</li>;
    <li>I like food</li>;
  </ul>
  </div>

}

export default HelloDiv;
